DROP TABLE IF EXISTS `tbl_usuarios`;
CREATE TABLE `tbl_usuarios` (
  `usu_codigo` int(11) NOT NULL AUTO_INCREMENT,
  `usu_nome` varchar(50) NOT NULL,
  `usu_login` varchar(20) NOT NULL,
  `usu_senha` varchar(255) NOT NULL,
  `usu_session_token` varchar(64) DEFAULT NULL,
  `usu_tipo` varchar(20) NOT NULL,
  `usu_situacao` varchar(2) NOT NULL COMMENT 'A - Ativo / I - Inativo',
  PRIMARY KEY (`usu_codigo`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='Tabela de Cadastro de Usuarios do Sistema';

